import React from "react";

const Main = () => {
  return (
    <section id="home">
      <div className="main-text">
        <h2>
          Inovação, Design e <strong>Experiência</strong>
        </h2>
        <p>Sempre a frente em soluções digitais</p>
        <a href="#servicos">Saiba mais</a>
      </div>
    </section>
  );
};

export default Main;
